var form=document.getElementById("my-form");async function handleSubmit(e){e.preventDefault();var t=new FormData(e.target);fetch(e.target.action,{method:form.method,body:t,headers:{Accept:"application/json"}}).then(e=>{swal({title:"THANK YOU!",text:"Your feedback has been succesfully Received",showConfirmButton:!0}),form.reset()}).catch(e=>{swal({title:"ERROR!",text:"Your feedback has not been Received",showConfirmButton:!0})})}form.addEventListener("submit",handleSubmit);